description:
Johnny's car broke down on his trip, luckily Mischa was nice enough to take him in until the tow truck comes in the morning. Mischa doesn't get a lot of visitors in her &quot;area&quot; and was spying on Johnny while he was changing. She gets caught and starts coming onto Johnny but, Johnny reminds her that he's a happily married man! Mischa thinks he has a pretty ring and Johnny has had a long day and needs to take a load off, his load onto her face!


